import React from "react";
import { CPage } from "@appcues/component-library";
import FlowListImage from "./flow-list.svg";

function Home() {
  return (
    <CPage textAlign="center">
      <CPage.Container>
        <img src={FlowListImage} />
      </CPage.Container>
    </CPage>
  );
}

export default Home;
